import React from 'react';
import {DoubleBounce} from 'better-react-spinkit';
import {Box, Text} from '@chakra-ui/react';

const Loader = props => {
    return (
        <Box>
            <DoubleBounce size={100} color='aqua' />
            <Box>
                <Text>Welcome</Text>,
                <br /><Text>Wait for a bit</Text>
            </Box>
        </Box>
    )
}

export default Loader;
